import React, { Component } from "react";
import NavComplete from "../components/navcomplete";

class Newsletter extends Component {
  state = {};
  render() {
    return (
      <div>
        <NavComplete />
        <div
          style={{
            position: "fixed",
            top: "50%",
            left: "50%",
            transform: "translate(-50%, -50%)",
          }}
        >
          <div style={{ display: "grid" }}>
            <div
              style={{
                fontFamily: "Unna",
                fontSize: 70,
                fontWeight: "bold",
                position: "relative",
                bottom: 50,
                backgroundColor: "rgba(252, 186, 3, .65)",
              }}
            >
              Join my newsletter
            </div>
            <div style={{ width: 100 }}>
              Enter your details below for a curated list of relevant articles,
              videos, and stories, delivered right to your mailbox â€“ once every
              two months.
            </div>
            <a
              href="#"
              style={{ textDecoration: "none", justifySelf: "center" }}
            >
              <div
                style={{
                  position: "relative",
                  backgroundColor: "black",
                  color: "white",
                  padding: 20,
                  fontSize: 40,
                  fontFamily: "Roboto",
                }}
              >
                Join here
              </div>
            </a>
          </div>
        </div>
      </div>
    );
  }
}

export default Newsletter;
